import React, { useState } from 'react';
import axios from 'axios';

const DeleteUser = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: ''
  });

  const [userData, setUserData] = useState(null); // State to store user data

  const handleChange = event => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  const handleSubmit = async event => {
    event.preventDefault();
    try {
      const response = await axios.get(`http://127.0.0.1:8000/users/${id}${formData.username}`);
      setUserData(response.data); // Set user data received from server
    } catch (error) {
      console.error('Error fetching user:', error);
      // Optionally, you can show an error message to the user
    }
  };

  const handleDelete = async () => {
    try {
      const response = await axios.delete(`http://127.0.0.1:8000/users/`);
      console.log(response.data);
      // Optionally, you can redirect the user to another page or show a success message
    } catch (error) {
      console.error('Error deleting user:', error);
      // Optionally, you can show an error message to the user
    }
  };

  return (
    <div className='main_top'>
      <button className='box_ grey' type="submit"><a href='/createuser'> Back</a></button>
      <h1>Delete User</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="username">Username:</label>
          <input
            type="text"
            id="username"
            name="username"
            value={formData.username}
            onChange={handleChange}
          />
        </div>
        <button className='box_ grey' type="submit">Fetch User Info</button>
      </form>

      {userData && ( // Display user data if available
        <div>
          <h2>User Info</h2>
          <div>
            <strong>Username:</strong> {userData.username}
          </div>
          <div>
            <strong>Email:</strong> {userData.email}
          </div>
          <div>
            <strong>Password:</strong> {userData.password}
          </div>
          <button className='box_ grey' onClick={handleDelete}>Delete User</button> {/* Move delete button outside the form */}
        </div>
      )}
    </div>
  );
};

export default DeleteUser;
